style.css:
@-moz-document domain("livehouse.in") {
  .chatroom-message, .online-list-ctn, .divider .divider-title, .message-list li, .online-list li, .block-list li, .mod-list li {
    background: #262626;
    background-color: rgb(37, 37, 37);
  }  
  .chatroom, .message-delete, .people-block, .people-mod, .message-delete:hover, .people-block:hover, .people-mod:hover {
    color: #BFBFBF;
  } 
  .message-time, .broadcast-status {
    color: rgba(192,192,192,0.4);
  }
  input {
    background-color: #262626;
    border-color: #BFBFBF;
  }
  .emotion-btn {
    color: rgba(192,192,192,0.2);
  }
  .right {
    background-color: #262626;;
  }
    
  /*popout*/
  .embed-chatroom {
    background-color: #262626;
    border-color: #262626;
    color: #BFBFBF;
  } 
  a {
    color: #BFBFBF;
    cursor: pointer
  }
}
